function miembrominService(){var i=new jsConnector;this.addMiembromin=function(e,t){try{i.post(url.miembromin.add,e,function(e){null!=e?(successMessage({title:message.miembromin.add.title,content:message.miembromin.add.success}),t(e)):errorMessage({title:message.miembromin.add.title,content:message.miembromin.add.error})})}catch(e){console.log(e)}},this.updateMiembromin=function(e,t){try{i.post(url.miembromin.update,e,function(e){null!=e&&1===e?(successMessage({title:message.miembromin.update.title,content:message.miembromin.update.success}),t(e)):errorMessage({title:message.miembromin.update.title,content:message.miembromin.update.error})})}catch(e){console.log(e)}},this.deleteMiembromin=function(e,t){try{i.post(url.miembromin.delete,e,function(e){null!=e&&1===e?(successMessage({title:message.miembromin.delete.title,content:message.miembromin.delete.success}),t(e)):errorMessage({title:message.miembromin.delete.title,content:message.miembromin.delete.error})})}catch(e){console.log(e)}},this.listMiembromin=function(t){try{i.post(url.miembromin.list,JSON.stringify({id:1}),function(e){null!=e&&0<e.length?t(e):infoMessage({title:message.miembromin.list.title,content:message.miembromin.list.empty})})}catch(e){console.log(e)}}}